import React from "react";
import AboutMain from 'components/organisms/AboutMain';

import { Link } from 'react-router-dom'
const About = () => {

  return (
    <nav>
       <ul className="ul">
        <Link to='/about-luminouss/main'> {'Vision&Mission'} </Link>
        <Link to='/about-luminouss/team'> Team </Link>
        <Link to='/about-luminouss/solution'> Solution </Link>
       </ul>
       <AboutMain />
    </nav>
  );
}

export default About;
